import React from 'react';
import './styles.css';

export default function Symptom({ symptom = 'none' }) {
  return (
    <div className="symptom-icon">
      <img alt={symptom.name} src={symptom.icon} />
      {/* <p>{symptom.name}</p> */}
    </div>
  );
}
